import React from 'react';
import './App.css';
import ButtonAppBar from "./components/appbar/appbar"

function App() {
  return (
    <div className="App">
      {/*APP BAR*/}
      <ButtonAppBar></ButtonAppBar>


      <div class="row">
        <div class="col s12">
        <ul id="austinfortson">
        <li class="scroll">Austin</li>
        <li class="scroll">Fortson</li>
      </ul>
        </div>
      </div>

    </div>
  );
}


export default App;
